import React from 'react'
import '../App.css'
import './AboutSection.css';

function AboutSection() {
    return (
        <div className='hero-container'>
            <h1>About Me!</h1>
            <p>I am passionate about the world of Software Technology and Data Science. </p>
            <p>I am creative, consistent, accurate, reliable for any task with attention to details.</p>
            <p>My strong commitment to excellence ensures that the end result is satisfactory.</p> 
            <p>I am always willing to go the extra mile to make sure it is not just a work or deliverable but rather the next best innovative and quality product.</p>
            <p>By: Vinay Parab</p>
        </div>
    )
}

export default AboutSection
